import React, { Component } from 'react';
import './App.css';
import Title from './components/Title';
import Control from './components/Control';
import List from './components/List';

class App extends Component {
    render() {
        return ( 
            <div className = "container" >                
                <div className="page-header">
                  <h1>To Do List <small>ReactJS</small></h1>
                </div>
                <div>                
                    <button type="button" className="btn btn-large btn-block btn-success">Add To-do</button>
                    <input type="text" className="form-control" placeholder="Filter"></input>
                </div>

                <div class="panel panel-success">
                      <div class="panel-heading">
                            <h3 class="panel-title">List Task</h3>
                      </div>
                      <div class="panel-body">
                            Panel content
                      </div>
                </div>

            </div>
        );
    }
}

export default App;
